import React from 'react'
import { withOktaAuth } from "@okta/okta-react";
import SignInWidget from "../Widgets/SignInWidget";

export default withOktaAuth(class Profile extends React.Component{

    renderUserInfo = () => {
        return (
            <div>
                <h3>Your Profile</h3>
                <div>Name: {this.props.authState.idToken.claims.email}</div>
                <div>EMail </div>
                <SignInWidget />
            </div>



        )

    }


    render() {
        console.log(this.props.authState.idToken.claims.email)
        return(

            <div>
                {this.props.authState.idToken ? this.renderUserInfo() : null}
            </div>
        )
    }
})
